import React, { useContext} from "react";
import {UserContext, EmailContext} from "../../App"


function ComponentF() {
    

    return (
        <div>
            <UserContext.Consumer>
                {
                    (username) => (
                        <EmailContext.Consumer>
                            {
                                (email) => (
                                    <h1>My name is {username}, and my email {email}.</h1>
                                )
                            }
                        </EmailContext.Consumer>

                    )
                }

            </UserContext.Consumer>
            
        </div>
    )
}

export default ComponentF
